import React, { Component } from 'react';
import {
    Form,
    Input,
    Tooltip,
    Icon,
    Cascader,
    Select,
    Row,
    Col,
    Checkbox,
    Button,
    AutoComplete,
  } from 'antd';

const FormItem = Form.Item;

class Login extends Component {
    render() {
        const AntWrappedLoginForm = Form.create()(LoginForm);
        return (
            <AntWrappedLoginForm onLogin={this.props.onLogin}/>           
        );
    }
}

class LoginForm extends Component  {
    constructor(props) {
        super(props);
    }

  render() {
    const {getFieldDecorator} = this.props.form;

    return (
        <div className="auth-wrapper">
            <div className="auth-content">
                <div className="auth-bg">
                    <span className="r"></span>
                    <span className="r s"></span>
                    <span className="r s"></span>
                    <span className="r"></span>
                </div>
                <div className="card">
                    <div className="card-body text-center">
                        <div className="mb-4">
                            <i className="feather icon-unlock auth-icon"></i>
                        </div>
                        <h3 className="mb-4">Login</h3>
                        <div className="input-group mb-3">
                        Form
                        <FormItem>
                            {getFieldDecorator('username', {
                                rules: [
                                    {
                                        required: true,
                                        message: 'Please input your username or email!'
                                    }
                                ]
                            })(
                                <Input
                                    className="form-control"
                                    prefix={<Icon type="user"/>}
                                    size="large"
                                    name="username"
                                    placeholder="Username or Email"
                                />
                            )}
                        </FormItem>
                            {/* <input type="email" className="form-control" placeholder="Email" /> */}
                        </div>
                        <div className="input-group mb-4">
                            <FormItem>
                                {getFieldDecorator('password', {
                                    rules: [
                                        {
                                            required: true,
                                            message: 'Please input your Password!'
                                        }
                                    ]
                                })(
                                    <Input
                                        prefix={<Icon type="lock"/>}
                                        size="large"
                                        name="password"
                                        type="password"
                                        placeholder="Password"
                                    />
                                )}
                            </FormItem> 
                            {/* <input type="password" className="form-control" placeholder="password" /> */}
                        </div>
                        <FormItem>
                            <div className="form-group text-left">
                                <div className="checkbox checkbox-fill d-inline">
                                    <input type="checkbox" name="checkbox-fill-1" id="checkbox-fill-a1" checked="" />
                                    <label for="checkbox-fill-a1" className="cr"> Save Details</label>
                                </div>
                            </div>
                            <button className="btn btn-primary shadow-2 mb-4">Login</button>
                        </FormItem>

                        <p className="mb-2 text-muted">Forgot password? <a href="auth-reset-password.html">Reset</a></p>
                        <p className="mb-0 text-muted">Donâ€™t have an account? <a href="auth-signup.html">Signup</a></p>
                    </div>
                </div>
            </div>
        </div>



    );
  }
}

export default Login;
